script: |
  super -f text -I q13562.spq | sort > q13562.out

inputs:
  - name: q13562.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col2 + - + col1 <= col0 * - + 68 - ( + col2 ) * + 59 / 77 * col1;
  - name: tab1

outputs:
  - name: q13562.out
    data: |
      51	14	96
      85	5	59
      91	47	68
